import React from "react";
import Navigastion from "./Navigastion/Navigastion";

import styles from "./";
const NAV_MENU = [
  { id: "1", name: "Шашлык" },
  { id: "2", name: "Шаурма" },
];

function NavMenu() {
  const navMenu = NAV_MENU.map((nav) => <Navigastion name={nav.name} />);
  return <div className={styles.container}>{navMenu}</div>;
}

export default NavMenu;
